DELIMITER //
CREATE PROCEDURE getItemInfo(in id int)
begin
	select *
	from item i, make mk, model mo, year y, compatibility c 
	where i.itemId = c.itemId 
		and y.yearId = c.yearId 
		and mo.modelId = y.modelId 
		and mk.makeId = mo.makeId 
		and i.itemId = id;
end //
DELIMITER ;

DELIMITER //
CREATE FUNCTION getItemName(id int) RETURNS varchar(255)
    DETERMINISTIC
begin
	declare name varchar(255);
	select itemName into name 
	from item 
	where itemId = id;
	return name;
end //
DELIMITER ;